          setInterval(function () {
            if (run == true)
              od.update(Math.floor(100000 + Math.random() * 900000));
          }, 2);

          run = false;
          buttonStart.innerText = "Start";
          buttonStart.style.background = "#fff";
          buttonStart.style.color = "#3483c5"
          od.update(list[i]);

          i + 1 < list.length ? i++ : (i = 0);
